import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { FaBox, FaTruck, FaExternalLinkAlt } from 'react-icons/fa';
import TrackingView from '../TrackingView';

const API_URL = process.env.REACT_APP_API_URL || 'http://localhost:5000/api';

const OrdersTab = () => {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const loadOrders = async () => {
      try {
        const token = localStorage.getItem('token');
        const response = await axios.get(`${API_URL}/orders/my-orders`, {
          headers: { Authorization: `Bearer ${token}` }
        });
        setOrders(response.data);
      } catch (error) {
        console.error('Error al cargar pedidos:', error);
      } finally {
        setLoading(false);
      }
    };
    loadOrders();
  }, []);

  const formatPrice = (price) => new Intl.NumberFormat('es-ES', { style: 'currency', currency: 'EUR' }).format(price);

  if (loading) return <div className="tab-loading">Cargando tus pedidos...</div>;

  if (orders.length === 0) return (
    <div className="empty-state">
      <FaBox size={48} />
      <h3>AÃºn no tienes pedidos</h3>
    </div>
  );

  return (
    <div className="orders-tab">
      <h2>Historial de Pedidos</h2>
      <div className="orders-list">
        {orders.map(order => (
          <div key={order._id} className="order-card">
            <div className="order-header">
              <div className="order-meta">
                <span className="order-id">#{order._id.slice(-8).toUpperCase()}</span>
                <span className="order-date">{new Date(order.createdAt).toLocaleDateString()}</span>
              </div>
              <span className={`status-badge ${order.orderStatus}`}>{order.orderStatus}</span>
            </div>

            {order.tracking && (
              <div className="tracking-realtime-card">
                <div className="tracking-header"><FaTruck /> Seguimiento</div>
                <div className="tracking-body">
                  <p><strong>Carrier:</strong> {order.tracking.carrier}</p>
                  {order.tracking.trackingUrl && (
                    <a href={order.tracking.trackingUrl} target="_blank" rel="noopener noreferrer" className="tracking-external-btn">
                      VER EN TIEMPO REAL <FaExternalLinkAlt size={12} />
                    </a>
                  )}
                </div>
              </div>
            )}

            <div className="order-items">
              {order.items.map((item, i) => (
                <div key={i} className="order-item">
                  <img src={item.product?.images?.[0] || 'https://via.placeholder.com/50'} alt="" />
                  <div className="item-details">
                    <p>{item.product?.name}</p>
                    <small>Cant: {item.quantity}</small>
                  </div>
                  <span>{formatPrice(item.price * item.quantity)}</span>
                </div>
              ))}
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default OrdersTab;
